import React, {useState, useRef} from 'react'
import ViewBooks from './ViewBooks'

export default function Login() {

    const [myBooks, setMyBooks] = useState([]);

    const email = useRef();
    const password = useRef();

    const validLogin = async (email, password) => {
        console.log(email.current.value, password.current.value);
    }

    return (
        <div class='container'>
            <div class='input-group mb-4 mt-5'>
                    <div class="input-group-prepend">
                        <span class="input-group-text" id="">Email</span>
                    </div>
                    <input ref={email} className='form-control' name="email" placeholder='Saiki Kusuo'/>
            </div>
            <div class='input-group mb-4'>
                    <div class="input-group-prepend">
                        <span class="input-group-text" id="">Password</span>
                    </div>
                    <input ref={password} className='form-control' name="password" placeholder='Saiki Kusuo'/>
            </div>
            <button class='btn btn-lg search-btn' onClick={validLogin(email, password)}>Login</button>
            <h1>LOGIN</h1>
            <ViewBooks />
        </div>
    )
}
